def solver(input_grid):
    import numpy as np
    from collections import deque

    grid = np.array(input_grid)
    output = grid.copy()
    H, W = grid.shape

    # Find background color (most frequent)
    unique, counts = np.unique(grid, return_counts=True)
    bg_color = unique[np.argmax(counts)]

    # Find all 0s and group into connected components
    zeros = set(map(tuple, np.argwhere(grid == 0)))
    visited = set()

    def bfs(start):
        comp = set()
        queue = deque([start])
        while queue:
            pos = queue.popleft()
            if pos in comp:
                continue
            comp.add(pos)
            r, c = pos
            for dr, dc in [(-1,0), (1,0), (0,-1), (0,1)]:
                nr, nc = r + dr, c + dc
                if (nr, nc) in zeros and (nr, nc) not in comp:
                    queue.append((nr, nc))
        return comp

    components = []
    for pos in zeros:
        if pos not in visited:
            comp = bfs(pos)
            visited.update(comp)
            components.append(comp)

    for comp in components:
        if len(comp) < 3:
            continue

        rows_idx = [p[0] for p in comp]
        cols_idx = [p[1] for p in comp]
        top, bottom = min(rows_idx), max(rows_idx)
        left, right = min(cols_idx), max(cols_idx)

        has_top = sum(1 for c in range(left, right + 1) if (top, c) in comp) >= 2
        has_bottom = sum(1 for c in range(left, right + 1) if (bottom, c) in comp) >= 2
        has_left = sum(1 for r in range(top, bottom + 1) if (r, left) in comp) >= 2
        has_right = sum(1 for r in range(top, bottom + 1) if (r, right) in comp) >= 2

        corners = {}
        if has_top and has_left: corners['TL'] = (top, left)
        if has_top and has_right: corners['TR'] = (top, right)
        if has_bottom and has_left: corners['BL'] = (bottom, left)
        if has_bottom and has_right: corners['BR'] = (bottom, right)

        if not corners:
            continue

        markers = {k: [] for k in corners}
        for r in range(max(0, top - 1), min(H, bottom + 2)):
            for c in range(max(0, left - 1), min(W, right + 2)):
                color = grid[r, c]
                if color != 0 and color != bg_color:
                    min_dist = float('inf')
                    closest = None
                    for cname, (cr, cc) in corners.items():
                        dist = abs(r - cr) + abs(c - cc)
                        if dist < min_dist:
                            min_dist = dist
                            closest = cname
                    if closest:
                        markers[closest].append((r, c, color))

        for corner_name, marker_list in markers.items():
            if not marker_list:
                continue

            cr, cc = corners[corner_name]

            color_counts = {}
            for mr, mc, color in marker_list:
                color_counts[color] = color_counts.get(color, 0) + 1

            dominant_color = max(color_counts, key=color_counts.get)
            same_color = [(mr, mc) for mr, mc, c in marker_list if c == dominant_color]
            same_color.sort(key=lambda x: abs(x[0] - cr) + abs(x[1] - cc), reverse=True)
            mr, mc = same_color[0]

            row_dist = abs(mr - cr)
            col_dist = abs(mc - cc)

            if corner_name == 'TL':
                base = [(cr, cc), (cr - 1, cc), (cr, cc - 1)]
                extra = (cr - 1, cc - 1)
                diag = (1, 1)
            elif corner_name == 'TR':
                base = [(cr, cc), (cr - 1, cc), (cr, cc + 1)]
                extra = (cr - 1, cc + 1)
                diag = (1, -1)
            elif corner_name == 'BL':
                base = [(cr, cc), (cr + 1, cc), (cr, cc - 1)]
                extra = (cr + 1, cc - 1)
                diag = (-1, 1)
            else:
                base = [(cr, cc), (cr + 1, cc), (cr, cc + 1)]
                extra = (cr + 1, cc + 1)
                diag = (-1, -1)

            for r, c in base:
                if 0 <= r < H and 0 <= c < W:
                    output[r, c] = dominant_color

            if row_dist >= 2 and col_dist >= 2:
                er, ec = extra
                if 0 <= er < H and 0 <= ec < W:
                    output[er, ec] = dominant_color

                dr, dc = diag
                for i in range(1, min(row_dist, col_dist)):
                    nr, nc = cr + i * dr, cc + i * dc
                    if 0 <= nr < H and 0 <= nc < W:
                        output[nr, nc] = dominant_color

    return output.tolist()
